INSERT INTO public.recipe VALUES (3, 1, 'Savory Spinach and Feta Stuffed Chicken Breast', '\', '*Prep Time: 15 minutes*

*Cook Time: 25 minutes*

*Total Time: 40 minutes*

*Serves: 4*

## Ingredients

- 4 boneless, skinless chicken breasts
- 2 cups fresh spinach, chopped
- 1/2 cup crumbled feta cheese
- 1/4 cup sun-dried tomatoes, drained and chopped
- 2 cloves garlic, minced
- 1 tablespoon olive oil
- 1/2 teaspoon dried oregano
- 1/2 teaspoon dried basil
- Salt and pepper to taste
- Toothpicks for securing

## Instructions

1. Preheat your oven to 375F (190C) and line a baking sheet with parchment paper.
2. Lay each chicken breast flat on a cutting board and make a horizontal slit in the thickest part of the breast to create a pocket for stuffing. Be careful not to cut all the way through.
3. In a medium bowl, mix together the chopped spinach, crumbled feta cheese, sun-dried tomatoes, minced garlic, olive oil, dried oregano, dried basil, salt, and pepper.
4. Spoon the spinach and feta mixture into the pocket of each chicken breast, then secure with toothpicks to hold the pocket closed.
5. Place the stuffed chicken breasts on the prepared baking sheet and bake in the preheated oven for 20-25 minutes, or until the internal temperature reaches 165F (74C) and the chicken is cooked through.
6. Remove the toothpicks before serving.
7. Serve hot and enjoy the delicious combination of savory spinach and tangy feta cheese in each bite of the stuffed chicken breast.

*Note: This recipe can also be cooked on a grill or stovetop in a skillet if desired. Adjust cooking times accordingly.*', false, DEFAULT);
INSERT INTO public.recipe VALUES (2, 2, 'Classic Spaghetti Bolognese', '\', '# Recipe guide

### Ingredients:

- 1 lb ground beef
- 1 tablespoon olive oil
- 1 onion, finely chopped
- 2 cloves garlic, minced
- 1 carrot, grated
- 1 celery stalk, finely chopped
- 1 can (28 oz) crushed tomatoes
- 1 teaspoon dried oregano
- 1 teaspoon dried basil
- 1/2 teaspoon salt
- 1/4 teaspoon black pepper
- 1/2 cup red wine (optional)
- 1/2 cup grated Parmesan cheese
- 1 lb spaghetti
- Fresh basil leaves for garnish (optional)

### Instructions:

1. Heat the olive oil in a large pot or skillet over medium heat.
1. Add the chopped onion, minced garlic, grated carrot, and chopped celery. Cook for 5-7 minutes until the vegetables are softened.
1. Add the ground beef to the pot and cook, breaking it up with a spoon, until browned and cooked through.
1. Stir in the crushed tomatoes, dried oregano, dried basil, salt, and black pepper. If using red wine, add it to the pot and let it simmer for a few minutes.
1. Reduce the heat to low and let the sauce simmer for at least 30 minutes, stirring occasionally to prevent it from sticking to the bottom of the pot.
1. Meanwhile, cook the spaghetti according to package directions until al dente.
1. Drain the cooked spaghetti and add it to the pot with the sauce. Toss to coat the spaghetti with the sauce.
1. Serve hot with a sprinkle of grated Parmesan cheese and fresh basil leaves, if desired.
1. Enjoy your classic spaghetti bolognese, a comforting and flavorful pasta dish that''s perfect for family dinners!', true, DEFAULT);
INSERT INTO public.recipe VALUES (4, 3, 'Lemon Garlic Shrimp Pasta', '\', '**Prep Time**: 10 minutes | **Cook Time**: 15 minutes | **Total Time**: 25 minutes | **Serves**: 4

## Ingredients

- 8 oz linguine or spaghetti
- 1 lb large shrimp, peeled and deveined
- 4 cloves garlic, minced
- 2 tablespoons butter
- 2 tablespoons olive oil
- 1/4 teaspoon red pepper flakes
- 1/2 cup chicken broth
- 1/4 cup freshly squeezed lemon juice
- Zest of 1 lemon
- Salt and pepper to taste
- Chopped fresh parsley for garnish

## Instructions

1. **Cook the pasta** according to package instructions until al dente. Drain and set aside.
2. **In a large skillet, melt the butter and olive oil** over medium heat.
3. **Add the minced garlic and red pepper flakes** to the skillet and saut for 1-2 minutes, until fragrant.
4. **Add the shrimp** to the skillet and cook for 2-3 minutes per side, until pink and cooked through. Remove the shrimp from the skillet and set aside.
5. **In the same skillet, add the chicken broth, lemon juice, and lemon zest**. Bring to a boil and let simmer for 2-3 minutes.
6. **Add the cooked pasta to the skillet** and toss to coat in the lemon garlic sauce. Cook for an additional 1-2 minutes, until heated through.
7. **Season with salt and pepper to taste**.
8. **Return the cooked shrimp to the skillet** and toss to combine with the pasta and sauce.
9. **Serve hot** with a sprinkle of chopped fresh parsley for garnish.

Enjoy the tangy and flavorful combination of lemon and garlic in this delicious shrimp pasta dish!

*Note: Adjust the red pepper flakes to your preferred level of spiciness. You can also add grated Parmesan cheese for an extra burst of flavor.*', true, DEFAULT);
INSERT INTO public.recipe VALUES (5, 2, 'Sheet Pan Lemon Herb Chicken with Roasted Vegetables', '\', '**Prep Time**: 15 minutes | **Cook Time**: 30 minutes | **Total Time**: 45 minutes | **Serves**: 4

## Ingredients

| Ingredient       | Amount          |
|------------------|------------------|
| Chicken thighs   | 4 bone-in, skin-on |
| Lemon             | 1 large, juiced and zested |
| Garlic cloves    | 4, minced       |
| Fresh rosemary    | 2 sprigs, chopped |
| Fresh thyme       | 2 sprigs, chopped |
| Olive oil         | 2 tablespoons |
| Salt              | 1 teaspoon     |
| Black pepper      | 1/2 teaspoon   |
| Carrots           | 4 large, peeled and cut into chunks |
| Red bell pepper   | 1 large, seeded and cut into chunks |
| Zucchini          | 2 medium, sliced into thick rounds |
| Yellow squash     | 2 medium, sliced into thick rounds |
| Red onion         | 1 large, cut into chunks |
| Balsamic vinegar  | 2 tablespoons |
| Fresh parsley     | Chopped for garnish |

## Instructions

1. **Preheat your oven** to 425F (220C) and line a large sheet pan with parchment paper.
2. **In a large bowl, whisk together** the lemon juice, lemon zest, minced garlic, chopped rosemary, chopped thyme, olive oil, salt, and black pepper to create a marinade.
3. **Add the chicken thighs to the marinade** and toss to coat evenly. Let marinate for 10 minutes.
4. **Place the marinated chicken thighs** on the prepared sheet pan, skin side up, and arrange the cut vegetables around the chicken.
5. **Drizzle the vegetables with balsamic vinegar** and season with additional salt and black pepper to taste.
6. **Roast in the preheated oven** for 25-30 minutes, or until the chicken is cooked through with an internal temperature of 165F (74C) and the vegetables are tender.
7. **Remove from the oven** and let rest for 5 minutes before serving.
8. **Garnish with chopped fresh parsley** and serve hot.

Enjoy this flavorful and easy sheet pan meal with juicy lemon herb chicken and roasted vegetables!

*Note: You can customize the vegetables to your liking or based on seasonal availability. Feel free to use your favorite herbs or spices in the marinade for added flavor.*', false, DEFAULT);
INSERT INTO public.recipe VALUES (1, 3, 'Easy One-Pan Chicken Stir-Fry', '\', '## Guide

### Ingredients:

- 1 lb boneless, skinless chicken breasts, thinly sliced
- 2 tablespoons vegetable oil
- 2 cloves garlic, minced
- 1/2 cup sliced bell peppers
- 1/2 cup sliced carrots
- 1/2 cup broccoli florets
- 1/4 cup soy sauce
- 2 tablespoons oyster sauce (optional)
- 1 tablespoon cornstarch
- Salt and pepper to taste
- Cooked rice for serving

### Instructions:

1. Heat a large pan or wok over medium-high heat and add the vegetable oil.
2. Add the minced garlic and cook for 30 seconds until fragrant.
3. Add the sliced chicken breasts to the pan and cook until they are no longer pink and are lightly browned. Remove the cooked chicken from the pan and set aside.
4. In the same pan, add a little more oil if needed, then add the sliced bell peppers, carrots, and broccoli. Cook for 2-3 minutes until they start to soften.
5. In a small bowl, whisk together the soy sauce, oyster sauce (if using), and cornstarch until well combined.
6. Pour the sauce mixture over the vegetables in the pan and stir-fry for another 2-3 minutes until the sauce thickens and coats the vegetables.
7. Add the cooked chicken back to the pan and stir-fry for another minute to coat the chicken with the sauce.
8. Season with salt and pepper to taste.
9. Remove from heat and serve hot over cooked rice.

### Enjoy your delicious and easy one-pan chicken stir-fry!', true, DEFAULT);


